import React from 'react'
import { Button } from 'reactstrap';

const DeleteSetting: React.FC = () => {

  return (
    <div>
      <div className="user-data-footer">
        <h2>Delete</h2>
        <p>If you want to delete something you can to writing the name a test and click on delete after it test will be !</p>
        <Button type="button" className="btn btn-danger">Delete all tests</Button>
      </div>
    </div>
  )
};

export default DeleteSetting;
